from typing import List
from config.treenode import TreeNode, listToTreeNode

class Solution:
  def inorderTraversal(self, root: TreeNode) -> List[int]:
    """Iterative.
    """
    x = []
    if root:
      node, stack = root, []
      while node or stack:
        while node:
          stack.append(node)
          node = node.left
        node = stack.pop()
        x.append(node.val)
        node = node.right
    return x
  def twoSumBSTs(self, root1: TreeNode, root2: TreeNode, target: int) -> bool:
    x1, x2 = self.inorderTraversal(root1), self.inorderTraversal(root2)
    s1, s2 = set(x1), set(x2)
    for v1 in x1:
      if target - v1 in s2:
        return True
    for v2 in x2:
      if target - v2 in s1:
        return True
    return False

